// ResumeFormProject.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ResumeFormProject({ resumeId }) {
  const [projectTitle, setProjectTitle] = useState('');
  const [projectContent, setProjectContent] = useState('');
  const [projectPeriod, setProjectPeriod] = useState('');
  const [isCurrent, setIsCurrent] = useState(false);
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    fetchProjects();
  }, [resumeId]);

  const fetchProjects = async () => {
    try {
      const response = await axios.get(`/api/resumes/${resumeId}/projects`);
      if (response.data) {
        setProjects(response.data);
      } else {
        console.error('Error fetching projects: Response data is empty');
      }
    } catch (error) {
      console.error('Error fetching projects:', error);
    }
  };

  const handleProjectSubmit = async () => {
    try {
      const response = await axios.post(`/api/resumes/${resumeId}/projects`, {
        project_title: projectTitle,
        project_content: projectContent,
        project_period: projectPeriod,
        is_current: isCurrent
      });
      if (response.status === 201) {
        setProjectTitle('');
        setProjectContent('');
        setProjectPeriod('');
        setIsCurrent(false);
        fetchProjects();
      } else {
        console.error('Error submitting project:', response.statusText);
      }
    } catch (error) {
      console.error('Error submitting project:', error);
    }
  };

  const handleDeleteProject = async (id) => {
    try {
      await axios.delete(`/api/resumes/${resumeId}/projects/${id}`);
      fetchProjects();
    } catch (error) {
      console.error('Error deleting project:', error);
    }
  };

  return (
    <div>
      <h2>PROJECT</h2>
      <div>
        <label>
          프로젝트명:
          <input type="text" value={projectTitle} onChange={(e) => setProjectTitle(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          부연설명:
          <input type="text" value={projectContent} onChange={(e) => setProjectContent(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          프로젝트기간:
          <input type="text" value={projectPeriod} onChange={(e) => setProjectPeriod(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          진행여부:
          <select value={isCurrent ? '진행중' : '완료'} onChange={(e) => setIsCurrent(e.target.value === '진행중')}>
            <option value="진행중">진행중</option>
            <option value="완료">완료</option>
          </select>
        </label>
      </div>
      <button onClick={handleProjectSubmit}>+</button>
      <h3>PROJECT 조회</h3>
      <ul>
        {projects.map((project) => (
          <li key={project.id}>
            <div>
              <strong>프로젝트명:</strong> {project.project_title}
            </div>
            <div>
              <strong>부연설명:</strong> {project.project_content}
            </div>
            <div>
              <strong>프로젝트기간:</strong> {project.project_period}
            </div>
            <div>
              <strong>진행여부:</strong> {project.is_current ? '진행중' : '완료'}
            </div>
            <button onClick={() => handleDeleteProject(project.id)}>X</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ResumeFormProject;
